import React from 'react';
import { Image, Text, View ,StyleSheet} from 'react-native';
const ItemFlower = () => {
    return (
        <View>
            <View>
                <Image
                 style={styles.logo}
        source={{
          uri: 'https://flowershop.com.vn/wp-content/uploads/2020/09/y-nghia-hoa-cuc-hoa-mi-6-min.jpg',
        }}
                />
                <View style={styles.text_center}>
                    <Text>Hoa cúc</Text>
                    <Text style={styles.bold}>Giá : 120.000đ</Text>
                </View>
            </View>
        </View>
    );
}
const styles = StyleSheet.create({
    itemFlower:{
        boxShadow:"1px 2px 3px 4px "
    },
    bold:{
        fontWeight:"bold"
    },
    text_center:{
       textAlign: 'center'
    },
    logo: {
        width: "177px",
        height: "152px",
    },
    container: {
      flex: 1,
      backgroundColor: "#fff",
      alignItems: "center",
      justifyContent: "center",
    },
    header: {
      backgroundColor: "#fff",
      textAlign: "center",
      fontWeight: "bold",
      fontSize: 50,
      color: "red",
      marginTop: 30,
    },
    list: {
      paddingHorizontal: 20,
      paddingTop: 40,
    },
    items: {
      backgroundColor: "pink",
      padding: 40,
      marginBottom: 10,
      fontSize: 50,
      borderRadius: 6,
    },
  });
  
export default ItemFlower;
